import React from 'react';
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'

function NavBar(){
return (
    <Row> 
        <Col xs={6} className="justify-content-left">
            <h4>Michael Schwarzbach</h4>
        </Col>

        <Col xs={1}>
            <h4>About</h4>
        </Col>
        <Col xs={1}>
            <h4>Projects</h4>
        </Col>
        <Col xs={1}>
            <h4>Contact</h4>
        </Col>
    </Row>

);
}

export default NavBar;
